import React from 'react';
import TopLogo from '../asset/images/top_logo.png';
const WebHeader: React.FC = () => {
    return (
        <div className='fixed top-0 left-0 w-full h-[60px]'>
            <div>
                <img src={TopLogo} alt={'toplogo'} width={150}/>
            </div>
        </div>
    );
};

export default WebHeader;
